//import '../../node_modules/sourcemapped-stacktrace/dist/sourcemapped-stacktrace.js';

import {Xen} from '../lib/xen.js';
Xen.Debug.level = window.logLevel;

console.log(`version: feb-22.0`);

window.DeviceClient = window.DeviceClient || {
  foundSuggestions(text) {
  }
};

// usage:
// ShellApi.observeEntity(`{"type": "address", "name": "North Pole"}`)

window.ShellApi = {
  receiveEntity(json) {
    console.log('received entity...');
    testMode = !json;
    run(json);
    return true;
  },
  async observeEntity(json) {
    console.log('observing entity...');
    let rawData;
    try {
      rawData = JSON.parse(json);
      console.log(rawData);
    } catch (x) {
      return false;
    }
    const store = context.findStoreById('addresses');
    await store.store({id: store.generateID(), rawData: {address: rawData.name}}, ['oogabooga']);
    console.log(await store.toList());
    return true;
  }
};

import {RamSlotComposer} from '../lib/ram-slot-composer.js';
import {Stores} from '../lib/stores.js';
import {Utils} from '../lib/utils.js';
import {Schemas} from './schemas.js';
import {App} from './app.js';

//import '../configuration/whitelisted.js';

// configure arcs environment
Utils.init(window.envPaths.root, window.envPaths.map);

let testMode;
const callback = text => {
  if (testMode) {
    console.log(`foundSuggestions (testMode): "${text}"`);
  } else {
    console.log(`invoking window.DeviceClient.foundSuggestions("${text}")`);
    //console.log(window.DeviceClient.foundSuggestions.toString());
    window.DeviceClient.foundSuggestions(text);
  }
};

let context;
const initContext = async () => {
  context = await Utils.parse('');
  await initAddressStore(context);
  return context;
};

const initAddressStore = async context => {
  const store = await Stores.create(context, {
    name: 'addresses',
    id: 'addresses',
    schema: Schemas.Address,
    isCollection: true,
    tags: null,
    storageKey: null
  });
  console.log(store);
  window.ShellApi.observeEntity(`{"type": "address", "name": "North Pole"}`);
  window.ShellApi.observeEntity(`{"type": "address", "name": "South Pole"}`);
};

const run = async json => {
  try {
    if (!context) {
      await initContext();
    }
    const composer = new RamSlotComposer();
    await App(composer, context, callback, json);
  } catch (x) {
    console.error(x);
  }
};

// test
//window.ShellApi.receiveEntity();

window.onclick = () => {
  window.ShellApi.receiveEntity();
};

import Xen from '../../modalities/dom/components/xen/xen.js';

Xen.Async = class extends Xen.Base {
  // shorthand for adding state,
  // equivalent to `this._setState(state)`
  set state(state) {
    this._setState(state);
  }
  get state() {
    return this._state;
  }
  get props() {
    return this._props;
  }
  // store result `await operation()` into state[name],
  // making sure to only invoke `operation` once even if
  // `awaitState` is called multiple times
  async awaitState(name, operation) {
    const state = this._state;
    const semaphore = `_await_${name}`;
    //console.warn('awaitState', name, state[semaphore]);
    if (!state[semaphore]) {
      state[semaphore] = true;
      const value = await operation();
      this.state = {[name]: value, [semaphore]: false};
    }
  }
  // underscore relief
  fire(name, detail) {
    this._fire(name, detail);
  }
  _getInitialState() {
    return this.getInitialState && this.getInitialState();
  }
  _update(props, state, oldProps, oldState) {
    return this.update && this.update(props, state, oldProps, oldState);
  }
  _render(props, state, oldProps, oldState) {
    return this.render && this.render(props, state, oldProps, oldState);
  }
  // event->state utility
  onState(e, data) {
    this._setState({[e.type]: data});
  }
};

export {Xen};

import {Template} from './xen-template.js';
import {XenStateMixin, debounce, nob} from './xen-state.js';
import Element from './xen-element.js';
import Base from './xen-base.js';
import {Debug, logFactory, walker} from './xen-debug.js';

// helper for editors that can syntax highlight html template strings
const html = (strings, ...values) => {
  return (strings[0] + values.map((v, i) => v + strings[i + 1]).join('')).trim();
};

Template.html = (...args) => Template.createTemplate(html(...args));

const clone = obj => typeof obj === 'object' ? Object.assign(Object.create(null), obj) : {};

const Xen = {
  State: XenStateMixin,
  Template,
  Element,
  Base,
  Debug,
  setBoolAttribute: Template.setBoolAttribute,
  html,
  walker,
  logFactory,
  clone,
  nob,
  debounce
};

window.Xen = Xen;
export default Xen;

